import React, { Component } from "react";


// fake data
const roles = [
	'Operador maquina',
	'Operador caldera',
	'Analista madera',
	'Analista RILES',
];


class Control_Risk extends Component{



	render() {

		return (

			<select>

				{roles.map( (rol, idx) =>

					<option value = {rol}> {rol} </option>

				)}

			</select>

		);

	}

}

export default Control_Risk;
